import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import './Booking.css';

function Booking({ user }) {
  const { artworkId } = useParams();
  const navigate = useNavigate();
  
  // Artwork state (you'll fetch this from your backend)
  const [artwork, setArtwork] = useState(null);
  
  // Form state
  const [formData, setFormData] = useState({
    customer_name: user?.full_name || user?.username || '',
    email: user?.email || '',
    phone: '',
    delivery_address: '',
    preferred_date: '',
    preferred_time: '',
    special_instructions: ''
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Fetch artwork details
  useEffect(() => {
    // TODO: Replace this with actual API call to fetch artwork details
    // For now, using dummy data
    setArtwork({
      artwork_id: artworkId,
      title: 'Sample Artwork',
      price: 50000,
      image_url: 'https://via.placeholder.com/300x400?text=Artwork',
      artist_name: 'Sample Artist'
    });
  }, [artworkId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      // Validate form
      if (!formData.customer_name || !formData.email || !formData.phone || 
          !formData.delivery_address || !formData.preferred_date || !formData.preferred_time) {
        setError('Please fill in all required fields');
        setLoading(false);
        return;
      }

      // Create booking object
      const bookingData = {
        booking_id: Date.now(), // Temporary ID until backend assigns real one
        artwork_id: artwork.artwork_id,
        artwork_title: artwork.title,
        artwork_image: artwork.image_url,
        artwork_price: artwork.price,
        customer_name: formData.customer_name,
        email: formData.email,
        phone: formData.phone,
        delivery_address: formData.delivery_address,
        preferred_date: formData.preferred_date,
        preferred_time: formData.preferred_time,
        special_instructions: formData.special_instructions,
        total_amount: artwork.price,
        status: 'pending',
        created_at: new Date().toISOString()
      };

      // Save to localStorage
      const existingBookings = JSON.parse(localStorage.getItem('userBookings') || '[]');
      existingBookings.push(bookingData);
      localStorage.setItem('userBookings', JSON.stringify(existingBookings));

      // TODO: When backend is ready, uncomment this:
      // const response = await bookingAPI.createBooking(bookingData);
      // if (response.data.success) {
      //   // Save to localStorage
      //   const existingBookings = JSON.parse(localStorage.getItem('userBookings') || '[]');
      //   existingBookings.push(response.data.booking);
      //   localStorage.setItem('userBookings', JSON.stringify(existingBookings));
      //   
      //   // Redirect to home
      //   navigate('/');
      // }

      // For now, just redirect to home after saving
      navigate('/');

    } catch (err) {
      setError('Failed to create booking. Please try again.');
      console.error('Booking error:', err);
    } finally {
      setLoading(false);
    }
  };

  if (!artwork) {
    return (
      <div className="booking-container">
        <div className="loading-spinner">
          <div className="spinner"></div>
          <p>Loading artwork details...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="booking-container">
      <div className="booking-wrapper">
        <div className="booking-content">
          {/* Left Side - Artwork Details */}
          <div className="artwork-summary">
            <h2>Artwork Details</h2>
            <div className="artwork-card">
              <img src={artwork.image_url} alt={artwork.title} />
              <div className="artwork-info">
                <h3>{artwork.title}</h3>
                <p className="artist-name">by {artwork.artist_name}</p>
                <div className="price-tag">
                  <span className="price-label">Price:</span>
                  <span className="price-value">₹{artwork.price.toLocaleString()}</span>
                </div>
              </div>
            </div>
          </div>

          {/* Right Side - Booking Form */}
          <div className="booking-form-section">
            <h2>Complete Your Booking</h2>
            
            {error && (
              <div className="error-message">
                <span className="error-icon">⚠️</span>
                {error}
              </div>
            )}

            <form onSubmit={handleSubmit} className="booking-form">
              {/* Customer Details */}
              <div className="form-section">
                <h3>Customer Details</h3>
                
                <div className="form-group">
                  <label htmlFor="customer_name">Full Name *</label>
                  <input
                    type="text"
                    id="customer_name"
                    name="customer_name"
                    value={formData.customer_name}
                    onChange={handleChange}
                    required
                    placeholder="Enter your full name"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="email">Email *</label>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                    placeholder="your.email@example.com"
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="phone">Phone Number *</label>
                  <input
                    type="tel"
                    id="phone"
                    name="phone"
                    value={formData.phone}
                    onChange={handleChange}
                    required
                    placeholder="+977 9800000000"
                  />
                </div>
              </div>

              {/* Delivery Details */}
              <div className="form-section">
                <h3>Delivery Details</h3>
                
                <div className="form-group">
                  <label htmlFor="delivery_address">Delivery Address *</label>
                  <textarea
                    id="delivery_address"
                    name="delivery_address"
                    value={formData.delivery_address}
                    onChange={handleChange}
                    required
                    rows="3"
                    placeholder="Enter your complete delivery address"
                  />
                </div>

                <div className="form-row">
                  <div className="form-group">
                    <label htmlFor="preferred_date">Preferred Date *</label>
                    <input
                      type="date"
                      id="preferred_date"
                      name="preferred_date"
                      value={formData.preferred_date}
                      onChange={handleChange}
                      required
                      min={new Date().toISOString().split('T')[0]}
                    />
                  </div>

                  <div className="form-group">
                    <label htmlFor="preferred_time">Preferred Time *</label>
                    <input
                      type="time"
                      id="preferred_time"
                      name="preferred_time"
                      value={formData.preferred_time}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
              </div>

              {/* Special Instructions */}
              <div className="form-section">
                <h3>Special Instructions (Optional)</h3>
                
                <div className="form-group">
                  <label htmlFor="special_instructions">Additional Notes</label>
                  <textarea
                    id="special_instructions"
                    name="special_instructions"
                    value={formData.special_instructions}
                    onChange={handleChange}
                    rows="4"
                    placeholder="Any special requirements or instructions for delivery..."
                  />
                </div>
              </div>

              {/* Submit Button */}
              <div className="form-actions">
                <button 
                  type="button" 
                  onClick={() => navigate(-1)}
                  className="btn-cancel"
                  disabled={loading}
                >
                  Cancel
                </button>
                <button 
                  type="submit" 
                  className="btn-submit"
                  disabled={loading}
                >
                  {loading ? 'Processing...' : 'Book Now'}
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Booking;
